"Геодерегі бар суреттерді, оның ішінде өзіңіз бөліскен суреттердің ішіндегі сақтап қойғандарыңызды қарап, болған жерлеріңізді еске алыңыз. Картаңыз төмендегідей геодеректі пайдаланады:

 • камераңыздың GPS координатасы;
 • анықталған көрнекті белгілер."

Құлыпталған қалтадағы сақтық көшірмесі жасалмаған фотосуреттер мен бейнелер мына жағдайларда сақталмайды":

 • құрылғыларды ауыстыру;
 • осы құрылғыны зауыттық параметрлерге қайтару;
 • Google Photos қолданбасын жою."

"Google Photos келесі қолданба деректерін құрылғыңыздан біржола жояды: 

• кірген аккаунттар; 
• параметрлер; 
• құлыпталған қалтада сақтық көшірмесі жасалмаған фотосуреттер мен бейнелер. 

Құлыпталған қалтадан тыс фотосуреттер мен бейнелер және басқа да қолданба деректері жойылмайды."
